import React from 'react';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';

import Contexts from './Contexts';
import setAuthToken from './utils/setAuthToken';
import PrivateRoute from './components/routing/PrivateRoute';

import Home from './components/pages/Home';
import About from './components/pages/About';
import NotFound from './components/pages/NotFound';
import Navbar from './components/layout/Navbar';
import Alert from './components/layout/Alert';
import GoalPage from './components/goals/GoalPage';
import GoalForm from './components/goals/GoalForm';
import Register from './components/auth/Register';
import Login from './components/auth/Login';
import UserPage from './components/auth/UserPage';
import SearchPage from './components/searchableUsers/SearchPage';
import FriendPage from './components/friends/Friend/FriendPage';
import FriendGoalPage from './components/friends/Friend/FriendGoalPage';
import CompetitionForm from './components/competitions/CompetitionForm';
import CompetitionPage from './components/competitions/CompetitionPage';

import './App.css';

if (localStorage.token) {
  setAuthToken(localStorage.token);
}

const App = () => {
  return (
    <Contexts>
      <Router>
        <Navbar/>
        <div className="container">
          <Alert/>
          <Switch>
            <Route exact path='/register' component={Register}/>
            <Route exact path='/login' component={Login}/>
            <Route exact path='/user' component={UserPage}/>
            <Route exact path='/' component={Home}/>
            <Route exact path='/goalform' component={GoalForm}/>
            <Route exact path='/goal' component={GoalPage}/>
            <Route exact path='/search' component={SearchPage}/>
            <Route exact path='/friend' component={FriendPage}/>
            <Route exact path='/friend/goal' component={FriendGoalPage}/>
            <Route exact path='/competitionform' component={CompetitionForm}/>
            <Route exact path='/competition' component={CompetitionPage}/>
            <Route exact path='/about' component={About}/>
            <Route component={NotFound}/>
          </Switch>
        </div>
      </Router>
    </Contexts>
  );
};

export default App;
